description:
20 Greatest Hits was a compilation album featuring a selection of songs by The Beatles that were number ones in the UK and US. It was released on 11 October 1982 in the United States and 18 October in the United Kingdom. 20 Greatest Hits was released to mark the 20th anniversary of The Beatles' first record release, &quot;Love Me Do,&quot; in the UK in 1962

